import React from 'react';
import './Product.css';
import PropTypes from 'prop-types';

const Product = (props) => {
  console.log(`${props.url}`)
  console.log(props.name)
  console.log(props.standardPrice);
  console.log(props.discountPrice);
  console.log(props.avatar);
  const pricing = () => {
    if (props.discountPrice < props.standardPrice) {
      return "red"
    } else {
      return "black"
    }
  }

  return (
    <div className="product">
      <img className="productImage" src={`${props.url}`} alt={`Product: ${props.name}`} />
      <p>{props.name}</p>
      <ul id="pricing">
        <li className={props.discountPrice < props.standardPrice ? "red" : "black"}>{props.discountPrice}</li>
        <li className="grey">{props.standardPrice}</li>
      </ul>
    </div>
  );
}

Product.propTypes = {
  name: PropTypes.string,
  productURL: PropTypes.string,
  standardPrice: PropTypes.number,
  discountPrice: PropTypes.number,
  avatar: PropTypes.number,
};

export default Product;
